import React, { useEffect, useState } from 'react';
import './FrontPage.css';
import { Link } from 'react-router-dom';
import EmployeeService from './services/EmployeeService';
import { Table, Button } from 'antd';

function FrontPage() {
  const [employee, setEmployee] = useState([]);

  const columns = [
    {
      title: "SI.No",
      dataIndex: "id",
      render: (_text, record, index) => index + 1,
    },
    {
      title: "FIRSTNAME",
      dataIndex: "firstName",
    },
    {
      title: "LASTNAME",
      dataIndex: "lastName",
    },
    {
      title: "EMAIL",
      dataIndex: "email",
    },
    {
      title: "MOBILENUMBER",
      dataIndex: "mobileNumber",
    },
    {
      title: "DOB",
      dataIndex: "dob",
    },
    {
      title: "ADDRESS",
      dataIndex: "address",
    },
    {
      title: "ACTIONS",
      dataIndex: "actions",
      render: (_text, record) => (
          <>
              <Button onClick={() => deleteRecords(record.id)} type="onSumbit"> DELETE
              </Button><Link to={`/edit-user/${record.id}`}>
                  <Button type="onSumbit">UPDATE</Button>
              </Link></>

      ),
    },
  ];

  useEffect(() => {
    getTemp();
  }, []);

  const getTemp = () => {
    EmployeeService.getEmployee()
      .then((response) => {
        console.log(response.data);
        setEmployee(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  function deleteRecords(employeeId) {
    EmployeeService.deleteRecords(employeeId)
      .then(() => {
        setEmployee(employee.filter((item) => item.id !== employeeId));
      })
      .catch((error) => {
        console.log(error);
      });
  }

  return (
    <div className="App">
      <div class="header">
        <div class="img">
          <img
            id="logo1"
            src="https://divum.in/images/logo/Divum%20LOGO%202022.svg"
            alt="Logo"
          />
        </div>
        <div className="btnn">
          <Link to="/login">
            <button type="submit" id="button">
              ADD
            </button>
          </Link>
          <Link to="/">
            <button type="submit" id="back-back">
              BACK
            </button>
          </Link>
        </div>
      </div>
      <div class="body">
        <Table id="pagination" columns={columns} dataSource={employee} />
      </div>
    </div>
  );
}

export default FrontPage;
